import React from "react";
import axios from "axios";
// import CurrentTime from "./CurrentTime";
// import Search from "./Search";

export default function WeatherApp(props) {
  let [city, setCity] = useState(null);
  let [characteristic, setCharacteristic] = useState(null);

  function NewCity(props) {
    setCity(props.target.value);
  }
  function temperature(props) {
    let temperature = props.data.main.temp;
    let description = props.data.weather[0].description;
    let humidity = props.data.main.humidity;
    let wind = props.data.wind.speed;
    let icon = `http://openweathermap.org/img/wn/${props.data.weather[0].icon}@2x.png`;

    setCharacteristic(
      <ul className="Properties">
        <li>Temperature: {Math.round(temperature)}°C</li>
        <li>Description: {description}</li>
        <li>Humidity: {humidity}%</li>
        <li>Wind: {Math.round(wind)}km/h</li>
        <li>
          <img src={icon} alt={description} />
        </li>
      </ul>
    );
  }
  function handleSubmit(props) {
    props.preventDefault();
    let apiUrl = `https://api.openweathermap.org/data/2.5/weather?q=${city}&appid=d2f8357c65447d4cec2a7942b9dfdd3d&units=metric`;
    axios.get(apiUrl).then(temperature);
  }

  return (
    <div className="Show">
      <form onSubmit={handleSubmit}>
        <input type="search" placeholder="Search city" onChange={NewCity} />
        <input type="submit" value="Search" />
      </form>
      {characteristic}
    </div>
  );

  return (
    <div className="WeatherApp">
      <div className="fild">
        <div className="WeatherFild">
          <div className="container">
            <div className="row d-flex justify-content-center">
              <form id="searchForm">
                <input
                  type="text"
                  className="city2"
                  id="city1"
                  required
                  placeholder="Enter your city"
                />
                <button type="submit" className="search" /*id="search1"*/>
                  Search
                </button>
              </form>
            </div>
            <div className="row d-flex justify-content-between mt-4">
              <div className="col-sm-7">
                <button className="current">Current weather</button>
              </div>
              <div className="col-sm-5 justify-content-left">
                <p className="lc" id="lc">
                  Vienna
                </p>
              </div>
            </div>
            <div className="row d-flex justify-content-between">
              <div className="col-sm-7">
                <img
                  src="https://em-content.zobj.net/thumbs/120/google/350/sun-behind-cloud_26c5.png"
                  alt=""
                  className="icon"
                  id="icon1"
                />
                <p className="temperature" id="temperature">
                  6°C
                </p>
              </div>
              <div className="col-sm-5">
                <p className="currentTime">{/* <CurrentTime /> */}</p>
                <p className="ffh">
                  Feels like: <span id="feelsLike">-4°C</span>
                  <br />
                  Forecast:
                  <span id="minTemp"> 1°C</span>/<span id="maxTemp">4°C</span>
                  <br />
                  Humidity:
                  <span id="humidity"> 60%</span>
                  <br />
                  Wind:
                  <span id="wind">0 km/h</span>
                </p>
              </div>
            </div>
            <div className="row d-flex justify-content-start">
              <div className="description" id="description-id">
                Few clouds
              </div>
            </div>
          </div>
        </div>
        <p className="owner">
          This website was coded by Olha Ovsii, and is{" "}
          <a href="https://github.com/Helga-ov/Weather" class="link">
            open-sourced
          </a>
        </p>
      </div>
    </div>
  );
}
